def transmigrate_character(n, m, k, current_skills, class_specific_skills):
    ESP = 1.0000001
    cur = {}
    for (skill, exp) in current_skills:
        new_exp = int(int(exp) * k + ESP)
        if new_exp >= 100:
            cur[skill] = new_exp
    for skill in class_specific_skills:
        cur.setdefault(skill, 0)
    z = len(cur)
    skills_after_transmigration = [(skill, cur[skill]) for skill in sorted(cur.keys())]
    return (z, skills_after_transmigration)

